    <div>
        <style>
            .email-signature-container {
                display: flex;
                border: 1px solid;
                width: 300px 300px;
                background-image: linear-gradient(#6ca4d8, white);
                justify-content: auto;
                padding: 20px;
            }
            .signature-img {
                height: 200px;
                border-radius: 200px;
                justify-content: left;
                margin: 0 60px 0 60px;
            }
            .personal-data {
                display: inline-block;
                border-left: 2px solid rebeccapurple;
                padding-left: 5px;
                font-family: sans-serif;
                color: #555;
            }
            .contact-info {
                display: block;
                height: 1;
            }
            .contact-info a {
                text-decoration: none;
            }
            .name {
                font-size: 1.1em;
                color: rebeccapurple;
                font-weight: bold;
            }
            .titles {
                font-size: 1.1em;
                margin-top: 5px;
                margin-bottom: 10px;
            }
            .contact-info-title {
                color: rebeccapurple;
            }
            .contact-info-company {
                font-size: 1.2em;
                font-weight: bold;
                color:blue;   
            }

            .contact-info-whats {
                color: green;  
            }

            .contact-info-social {
                padding-top: 40px 40px;
                margin-top: 10px;
                
            }

            .social_links {
                display: grid;
                grid-template-columns: 0.15fr 0.15fr 0.15fr 0.15fr 0.25fr;
                padding-top: 3%;

            }

            .social_links a:hover {
                transform: scale(1.15);
                transition: transform 0.6s ease;
            }
        </style>
